local header_generation

local alpha = {{
    "goolord/alpha-nvim",
    config = function()
        dashboard = require("alpha.themes.dashboard")

        header_config = header_confgen()
        dashboard.section.header.val = header_config.val
        dashboard.section.header.opts = header_config.opts
        
        dashboard.section.buttons.val = {
            dashboard.button("n", " " .. " New File", "<cmd>enew <CR>"),
            dashboard.button("l", "󰒲 " .. " Lazy", "<cmd>Lazy <CR>"),
            dashboard.button("e", "󰙅 " .. " File Explorer", "<cmd>NvimTreeToggle <CR>"),
            dashboard.button("r", " " .. " Recent files", "<cmd>Telescope oldfiles <CR>"),
            dashboard.button("f", " " .. " Find file", "<cmd>Telescope find_files <CR>"),
            dashboard.button("g", " " .. " Find text", "<cmd>Telescope live_grep <CR>"),
            dashboard.button("d", "󱖫 " .. " Diagnostics", "<cmd>Trouble diagnostics toggle <CR>"),
            dashboard.button("s", "󰊢 " .. " Git Status", "<cmd>Telescope git_status <CR>"),
            dashboard.button("q", " " .. " Quit", "<cmd>qa <CR>")
        }

        vim.api.nvim_set_hl(0, "AlphaShortcuts", { fg = "#a3be8c" })
        vim.api.nvim_set_hl(0, "AlphaButtons", { fg = "#8fbcbb" })
        for _, button in ipairs(dashboard.section.buttons.val) do
            button.opts.hl = "AlphaButtons"
            button.opts.hl_shortcut = "AlphaShortcuts"
        end
        
        require("alpha").setup(dashboard.config)
    end
}}

